import React from 'react';
import NavBar from './NavBar.js';
import MessageBox from './MessageBox.js';
import InputForm from './InputForm.js';

function App() {
  return (
    <div className="App">
      <NavBar/>
      <table id = "content" style={{"width": "1180px", "height": "650px"}}>
			<tr>
				<td style={{"vertical-align": "0%"}}>

					<MessageBox/>
					<center>
						<button type="del" id="ClearAll">ClearAll</button>
					</center>
				</td>
				<td style={{"vertical-align": "0%"}}>
					<InputForm/>
				</td>
			</tr>
		</table>
    </div>

  );
}

export default App;
